import {useEffect,useState} from 'react'
import styled from 'styled-components'
import {useDispatch,useSelector} from 'react-redux'
import { getlogInitiate } from '../../Actions/logging'
const Lastedit = () =>{
    const {logdata,editlog} = useSelector(state=>state.log)
    const loghandler = (id) =>{
        console.log(id)
    }
    const dispatch = useDispatch()
    useEffect(()=>{
        dispatch(getlogInitiate())
    },[])
    return(
        <Container>
            <Edit>
                {logdata.map((item)=>(
                    item.actiontype === 'edited' ?
                    <div key={item.id}>
                    <li>{item.code} {item.actiontype} {item.owener}  by {item.user} time: {item.time.toDate().toLocaleString()}</li>
                    <span onClick={()=>loghandler(item.id)}>||</span>
                    <div>
                       {item.editlogdata.oldcode !== item.editlogdata.newcode}  {<div>{item.editlogdata.oldcode} changed to {item.editlogdata.newcode}</div>}
                       {item.editlogdata.olddomain !== item.editlogdata.newdomain} {<div>{item.editlogdata.olddomain} changed to {item.editlogdata.newdomain}</div>}
                {item.editlogdata.oldcpanel !== item.editlogdata.newcpanel} {<div>{item.editlogdata.oldcpanel} changed to {item.editlogdata.newcpanel}</div> }
                        <div>{item.editlogdata.oldusername} changed to {item.editlogdata.newusername}</div>
                        <div>{item.editlogdata.oldpassword} changed to {item.editlogdata.newpassword}</div>
                        <div>{item.editlogdata.olddomainExpireDate} changed to {item.editlogdata.newdomainExpireDate}</div>
                        <div>{item.editlogdata.oldhostingExpireDate} changed to {item.editlogdata.newhostingExpireDate}</div>
                        <div>{item.editlogdata.oldsslExpireDate} changed to {item.editlogdata.newsslExpireDate}</div>
                    </div>
                    </div>
                    :
                    <li>{item.code} {item.actiontype} {item.owener}  by {item.user} time: {item.time.toDate().toLocaleString()}</li>
                )
                )}
            </Edit>
        </Container>
    )
}
const Container = styled.div`
    background-color:purple;
    height:25vh;
    text-align:center;
    color:white;
    overflow: scroll;
`
const Edit = styled.ul`
    li{
        padding-top:10px;
    }

`
export default Lastedit
